import React from 'react';

import './App.css';
import {tweets} from '../../constants';

console.log(tweets);
const App = () => (
<html>
    <h1>{tweets[0].fullname}</h1>
    <img src={tweets[0].avatar}></img>
</html>
);

export default App;
